import LogoNav from "../Navbars/logo-nav";
import {Link} from 'react-router-dom'
function Tech(props){
    return(
        <>
            <LogoNav />
            <h1>Tech page</h1>
            <Link to={`/tech/:`} />
        </>
    )
}

export default Tech;
